import {
    add,
    sub,
    multiply,
    divide
} from './App';

function calc(){
    return(
        <>
        <h1> calculator </h1> 
        <ul>
            <li> addition of {add(2, 4)} </li> 
            <li> subtraction {sub(4, 1)} </li> 
            <li> multiplication {multiply(2, 5)} </li> 
            <li> division {divide(8, 2)} </li> 
            </ul>



            </>
    )
}
export default calc;
